(1, 'Legal Information on nebulabin.org', '                                       __  ___             ____  _     \r\n                                      /  |/  /__ _      __/ __ )(_)___ \r\n                                     / /|_/ / _ \\ | /| / / __  / / __ \\\r\n                                    / /  / /  __/ |/ |/ / /_/ / / / / /\r\n                                   /_/  /_/\\___/|__/|__/_____/_/_/ /_/\r\n\r\n                                     Legal Information Takedown Policy\r\n================================================================================ \r\n\r\nContact Information:  \r\n--------------------  \r\n  \r\nLegal Law Enforcement Requests: legal@nebula.report\r\n\r\nGeneral Inquiries (Non-Legal): @govervl on telegram\r\n\r\n================================================================================  \r\n\r\n\r\nTakedown Policy:  \r\n-------------------\r\nThe only conditions under which a paste will be removed from Nebulabin.org are the following  \r\n\r\n\r\n\r\n1. Breaks Our Terms of Service (ToS)  \r\n\r\n2. Legal Court Order from Our Registrar‚Äôs Country (United States)  \r\n\r\n3. An Official Request from a Law Firm, Law Enforcement, or Government Agency Accompanied by a Valid Court Order  \r\n\r\n   - 3.1: Court orders issued outside of U.S. jurisdiction must include a Mutual Legal Assistance Treaty [MLAT] request recognized by the United States.  \r\n\r\n================================================================================  \r\n\r\n\r\n\r\nLegal Takedown Request Requirements:  \r\n-------------------\r\n\r\nTo process a LEGAL takedown request, the following information must be provided:  \r\n\r\n- A clear explanation of the legal violation  \r\n\r\n- The specific URL(s) of the content in question  \r\n\r\n- Proof of authority from the requesting entity  \r\n\r\n- A valid legal basis under U.S. law (for non-ToS violations)  \r\n\r\n\r\n\r\nRequests that do not meet these standerds will be ignored.  \r\n\r\n\r\n====